import styled, { css } from "styled-components";

export const AboutMeContainer = styled.div`
    position: relative;
    height: 100%;
    justify-content: space-evenly;
    align-content: center;
`;

export const PersonalInfo = styled.div`
    display: flex;
    flex-direction: column;
    gap: 20px;
    padding: 20px;
    width: 100%;

    h3 {
        margin-bottom: 10px;
        font-size: 18px;
        font-weight: 700;
        color: #f9d342;
    }

    span {
        font-size: 1.5rem;
        font-weight: 700;
        letter-spacing: 0.5px;
        border-bottom: 2px solid #f9d342;
        position: relative;
        display: inline-block;
        margin-right: 16px;
        padding-bottom: 5px;
        color: #ffe67c;
    }
`;

export const DeveloperDescription = styled.div`
    display: flex;
    gap: 20px;
    padding: 20px;
    width: 100%;

    h2 {
        color: #f9d342;
        font-size: 1rem;
        padding-bottom: 20px;
        border-bottom: 1px dashed #f9d342;
    }

    p {
        color: #ffe67c;
        font-size: 1rem;
        line-height: 1.65;
    }
`;
